import React, { useEffect, useState } from "react";
import Moviebox from "./Moviebox";
import "./Movies.css";
function Movies() {
  const [movies, setMovies] = useState([]);
  const API_URL =
    "https://api.themoviedb.org/3/movie/550?api_key=da5ab5b5b2a262c4362af18406224e09";
  useEffect(() => {
    fetch(API_URL)
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        setMovies(data.results);
      });
  }, []);
  return (
    <>
      <section className="">
        {movies.map((movie) => (
          <Moviebox />
        ))}
      </section>
    </>
  );
}

export default Movies;
